function App() {
  return (
    <Container
      className="d-flex align-items-center justify-content-center"
      style={{ minHeight: "100vh" }}
    >
      <AuthProvider> </AuthProvider>

      <div className="w-100" style={{ maxWidth: "500px" }}>
        <LogIn />
      </div>
    </Container>
  );
}

export default App;
